import React, { Component, Fragment } from 'react';
import './Header.css'
import logo from './logo.svg';


const Header = () =>{
    return(
        <Fragment>
            <div className='header'>
                <img className='logo' src = {logo} ></img>
            </div>
        </Fragment>
    )
}

export default Header;
